script: |
  super -f text -I q7788.spq | sort > q7788.out

inputs:
  - name: q7788.spq
    data: |
      SELECT DISTINCT - 33 + - + COUNT ( * ) + ( COUNT ( * ) ) * MIN ( 52 ) FROM tab1 (FORMAT parquet) WHERE - col0 <> ( col1 + col1 * + 22 );
  - name: tab1

outputs:
  - name: q7788.out
    data: |
      120
